package understat

import (
	"fmt"
	"github.com/anaskhan96/soup"
	"regexp"
	"strconv"
	"strings"
)

var (
	leagueUrl = "https://understat.com/league"
	pattern = `datesData\s+=\s+JSON.parse\(\'(.*?)\'\)`
)

type Result struct {
	XG string `json:"xg"`
	DateTime string `json:"datetime"`
}

func GetLeagueFixtures(league, season string) {
	url := fmt.Sprintf(leagueUrl + "/%s/%s", league, season)

	resp, err := soup.Get(url)

	if err != nil {
		panic("Oh Shit")
	}

	re := regexp.MustCompile(pattern)

	doc := soup.HTMLParse(resp)
	scripts := doc.FindAll("script")

	for _, sc := range scripts {
		if match := re.MatchString(sc.Text()); match {
			s := re.FindAllString(sc.Text(), -1)

			newRe := regexp.MustCompile(`(?s)\((.*)\)`)

			t := newRe.FindAllStringSubmatch(s[0], -1)

			rep := strings.Replace(t[0][1], "'", "", -1)

			rep = strconv.Quote(rep)

			byt := []byte(rep)

			fmt.Printf("String: %s", byt)
			//var fixtures []Fixture
			//
			//err := json.Unmarshal(byt, &fixtures)
			//
			//if err != nil {
			//	panic(err)
			//}
			//
			//fmt.Printf("Fixtures: %+v", fixtures)
		}
	}
}

